import styled from "styled-components";

function InserirHabito() {
    return (
        <Container>
            <h1>Caixinha de habito novo</h1>
        </Container>
    )
}

const Container = styled.div `
    width: 340px;
    height: 180px;
    margin: 0 auto;
    margin-bottom: 28px;
    background-color: #FFFFFF;

`

export default InserirHabito;
